import React from "react";
import "./Product.css";

export const Products = ({ products }) => {
  return (
    <div className="product">
      <h1>Test Produkt</h1>
      <div className="content">
        <p>Artnr: 00000</p>
        <p id="price">999:99</p>
      </div>
    </div>
  );
};
